        require(IAccessControl(address(this)).isScopesCompatible(memberScopeId, requests[i].scopeId), "Illegal Admin Scope");
      }       

      // check access
      require(_doCheckAdminAccess(requestedScope.adminId, senderId, functionId), "Forbidden");

      // create new type
